import { useParams } from 'react-router-dom';
import { Comments, Header, Content } from '../../../containers';

const Project = (props) => {



  return (
    <div className='App'>
      <div>
        <Header/> 
      </div>   
        <Content/>
      <div className='divider'></div>
        <Comments/>
    </div>
  )
}

export default Project
